        "# ========== * For Input scenarios * ================\n",
        "import numpy as np\n",
        "from scipy.integrate import odeint\n",
        "import matplotlib.pyplot as plt\n",
        "\n",
        "# Define the SIR model with PID-controlled interventions\n",
        "def sir_model(y, t, beta, gamma, lockdown, vaccination):\n",
        "    S, I, R = y\n",
        "    dS_dt = -beta * S * I + vaccination * S  # Susceptible\n",
        "    dI_dt = beta * S * I - gamma * I         # Infected\n",
        "    dR_dt = gamma * I + vaccination * S      # Recovered\n",
        "    return [dS_dt, dI_dt, dR_dt]\n",
        "\n",
        "# PID controller\n",
        "class PID:\n",
        "    def __init__(self, Kp, Ki, Kd):\n",
        "        self.Kp = Kp\n",
        "        self.Ki = Ki\n",
        "        self.Kd = Kd\n",
        "        self.integral = 0\n",
        "        self.previous_error = 0\n",
        "\n",
        "    def update(self, setpoint, current_value, dt):\n",
        "        error = setpoint - current_value\n",
        "        self.integral += error * dt\n",
        "        derivative = (error - self.previous_error) / dt\n",
        "        output = self.Kp * error + self.Ki * self.integral + self.Kd * derivative\n",
        "        self.previous_error = error\n",
        "        return output\n",
        "\n",
        "# Collect user inputs\n",
        "case_name = input(\"Enter the case name (e.g., 'High Infection Rate Test'): \")\n",
        "S0 = float(input(\"Enter initial proportion of Susceptible population (e.g., 0.99 for 99%): \"))\n",
        "I0 = float(input(\"Enter initial proportion of Infected population (e.g., 0.01 for 1%): \"))\n",
        "R0 = 1 - S0 - I0  # Calculate initial Recovered based on S0 and I0\n",
        "\n",
        "beta = float(input(\"Enter the infection rate β (e.g., 0.3): \"))\n",
        "gamma = float(input(\"Enter the recovery rate γ (e.g., 0.1): \"))\n",
        "vaccination_rate = float(input(\"Enter the vaccination rate (e.g., 0.01): \"))\n",
        "\n",
        "Kp = float(input(\"Enter the PID proportional gain (Kp): \"))\n",
        "Ki = float(input(\"Enter the PID integral gain (Ki): \"))\n",
        "Kd = float(input(\"Enter the PID derivative gain (Kd): \"))\n",
        "\n",
        "setpoint = float(input(\"Enter the target infection rate (setpoint, e.g., 0.05): \"))\n",
        "\n",
        "# Simulation time settings\n",
        "t = np.linspace(0, 160, 160)  # Time frame\n",
        "\n",
        "# PID controller setup\n",
        "pid = PID(Kp=Kp, Ki=Ki, Kd=Kd)\n",
        "\n",
        "# Run the simulation\n",
        "S, I, R = S0, I0, R0\n",
        "results = []\n",
        "for time in t:\n",
        "    lockdown_intensity = pid.update(setpoint, I, dt=1)\n",
        "    lockdown_intensity = max(0, min(lockdown_intensity, 1))  # Clamp between 0 and 1\n",
        "    new_beta = beta * (1 - lockdown_intensity)  # Adjust beta based on lockdown\n",
        "\n",
        "    # Solve SIR differential equations for the current step\n",
        "    solution = odeint(sir_model, [S, I, R], [time, time + 1], args=(new_beta, gamma, lockdown_intensity, vaccination_rate))\n",
        "    S, I, R = solution[1]  # Update values\n",
        "\n",
        "    # Store the results\n",
        "    results.append([S, I, R, lockdown_intensity])\n",
        "\n",
        "# Convert results to numpy array for easy plotting\n",
        "results = np.array(results)\n",
        "\n",
        "# Plotting results\n",
        "plt.figure(figsize=(10, 6))\n",
        "plt.plot(t, results[:, 1], label=\"Infected\", color=\"r\")\n",
        "plt.plot(t, results[:, 3], label=\"Lockdown Intensity\", color=\"b\", linestyle=\"--\")\n",
        "plt.xlabel(\"Time\")\n",
        "plt.ylabel(\"Proportion of Population\")\n",
        "plt.title(f\"Di0sease Spread with PID-Controlled Lockdown\\nCase Study: {case_name}\")\n",
        "plt.legend()\n",
        "plt.show()\n"
